import React from "react";
import ReactDOM from "react-dom";
import "./index.css"
const date = new Date().toLocaleDateString();
const time= new Date().toLocaleTimeString();
const name='Ankit yadav';
const img1="https://picsum.photos/200/300";
const img2="https://picsum.photos/250/300";
const img3="https://picsum.photos/270/300";
const img4="https://picsum.photos/300/300";
const link="http://ipskoderma.in/"
ReactDOM.render(
	<>
	<h1 className="header" contentEditable="true">My name is {name}</h1>
	<div className="img_div">
	<img src={img1} alt="there is supposed to be a image" />
	<img src={img2} alt="there is supposed to be a image" />
	<img src={img3} alt="there is supposed to be a image" />
	<a href={link}><img src={img4} alt="there is supposed to be a image" /></a>
	</div>
	<div className="timing">
	<h2>current date is {date}</h2>
	<h2 >current time is {time} </h2>
	</div>

	</>
	      ,document.getElementById("root"));
